@serde is a wrapper of @serialize and @deserialize decorators. This code @serde
@dataclass
class Foo: ... is equivalent to the following code. @deserialize
@serialize
@dataclass
class Foo: ... @serde decorator does these for you: Add @serialize and @deserialize decorators to a class Add @dataclass decorator to a class if a class doesn't have @dataclass You can pass both (de)serialize attributes to the decorator serializer attribute is ignored in @deserialize and deserializer attribute is ignored in @serialize @serde(serializer=serializer, deserializer=deserializer)
@dataclass
class Foo: ... NOTE: @serde actually works without @dataclass decorator, because it detects and add @dataclass to the declared class automatically. However, mypy will produce Too many arguments or Unexpected keyword argument error. This is due to the mypy limitation . @serde
class Foo: ... But if you use a PEP681 compliant type checker (e.g. pyright), you don't get the type error because pyserde supports PEP681 dataclass_transform

