rename_all can converts field names into the specified string case. The following example converts camel case field names into snake case names. Case coversion depends on python-casefy . You can find the list of supported cases in the python-casefy's docs . @serde(rename_all = 'camelcase')
@dataclass
class Foo: int_field: int str_field: str f = Foo(int_field=10, str_field='foo')
print(to_json(f)) "int_field" is converted to "intField" and "str_field" is converted to "strField". {"intField": 10, "strField": "foo"} NOTE: If rename_all class attribute and rename field attribute are used at the same time, rename will be prioritized. @serde(rename_all = 'camelcase')
class Foo: int_field: int str_field: str = field(rename='str-field') f = Foo(int_field=10, str_field='foo')
print(to_json(f)) The above code prints {"intField": 10, "str-field": "foo"} See examples/rename_all.py for the complete example.

